      "title":"Groomsman Gift PERSONALISED Harris Tweed Hip Flask Groomsman HT09 Scottish Luxury Gift Wedding for Him Usher Best Man",
      "description":"This product has been shortlisted in the Gift of the Year Awards 2018.  \n\nHarris Tweed wrapped 6oz Hip Flask would make a lovely gift for that someone special sold complete with its own beautiful gift box\n\nThe sleeve can be personalised by embroidering initials or words up to 10 characters.\n\nAll parcels will be sent out 2nd class unless upgraded postage has been selected and paid for.\n\nThe flask itself is stainless steel and is wrapped in a snug fitting, removable Harris Tweed jacket which has been lined in our own iconic fabric which features water colour paintings from Edinburgh artist The Arty Penguin.  The iconic Orb label stitched to the front ensures the authenticity of the cloth\n\nDepending on how the cloth has been cut may result in pattern variation, making each one unique but just as lovely.\n\nIf you can&#39;t find what you are looking for, please get in touch.\n\nHarris Tweed, or Clo Mor (The Big Cloth) is the only fabric in the world governed by its own Act of Parliament. \n\nFrom start to finish the cloth is in the hands of skilled and experienced artisans who oversee every stage of production utilising generations of knowledge to produce a product worthy of the name Harris Tweed. \n\nFurthermore a 1993 Act of Parliament underpins the unique status of Harris Tweed and decrees that genuine Harris Tweed must be made from pure virgin wool which has been dyed and spun on the islands and handwoven at the home of the weaver in the Outer Hebrides of Scotland. \n\nHarris Tweed is about quality and style, history and heritage. It is the fabric of choice for many of the world\u2019s leading designers as well as their most discerning clients. When you buy Harris Tweed you are guaranteed the best, safe in the knowledge that the Orb secures a perfect cloth for years of use.",
