        "title":"Handmade little things for kids and parents, made in NJ",
        "announcement":"Hello and welcome to the home of various little hand-made little things. \r\n\r\nBrowse all items or browse by categories, if you wish - currently there are 5 \r\n- WINE BAGS  https:\/\/www.etsy.com\/shop\/LittleThingsToGo?section_id=20513885\r\n- SEATBELT \/STRAP COVERS https:\/\/www.etsy.com\/shop\/LittleThingsToGo?section_id=20583220\r\n- BABY (teepees\/burpcloths)  https:\/\/www.etsy.com\/shop\/LittleThingsToGo?section_id=20892801\r\n- VINTAGE JEWELRY https:\/\/www.etsy.com\/shop\/LittleThingsToGo?section_id=20892801\r\n- CORKS https:\/\/www.etsy.com\/shop\/LittleThingsToGo?section_id=22355813\r\n\r\nI&#39;m frequently tweaking and adding items. If you see something you like, but would like to customize it - different color, size or snaps instead of velcro - just send me a message and I&#39;d be happy to help you if I can\r\n\r\nHappy Shopping!",
        "currency_code":"USD",
        "is_vacation":false,
        "vacation_message":"I am on vacation May 27- June 2. While I might be able to answer some questions, I will have no access to my inventory or store. I will resume sewing and shipping June 3. Thank you and thanks for browsing my store. \r\nJulia",
        "sale_message":"Thank you so much for your purchase from Little Things To Go! \r\nMy current turnaround time for shipping is 1-3 business days. I ship via USPS First Class Mail (up to 13 oz) which typically takes 3-5 business days and includes tracking. It might sometimes take USPS longer during busy holiday seasons or inclement weather.\r\nIf you have any question or concerns about your order, please contact me and I will work with you to remedy it! If you are pleased with your order, please share your experience with others by leaving feedback!\r\n\r\nJulia\r\nLittle Things To Go\r\n\r\n*** The best compliment is a referral. If you liked what you found in my store, please share it with your friends. *** ",
