        "accepts_custom_requests":true,
        "policy_welcome":null,
        "policy_payment":"SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
        "policy_shipping":"PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nESTIMATED SHIPPING TIME\nNorth America: 1 - 3 business days\n\nI'll do my best to meet these shipping estimates, but cannot guarantee them. Actual delivery time will depend on the shipping method you choose.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
        "policy_refunds":"I GLADLY ACCEPT CANCELLATIONS\nRequest a cancellation within: 1 hour of purchase\n\nI DON'T ACCEPT RETURNS OR EXCHANGES\nBut please contact me if you have any problems with your order.",
        "policy_additional":"SIZING DETAILS\nPLEASE SEE INDIVIDUAL ITEM DESCRIPTIONS. Here are the general sizing details, for most, but not all items.\n\nSEAT BELT STRAP COVERS: most common size is about 6 x 7 inches (6x3 when folded), wrap around most seat belts straps, carseat straps or stroller straps that are 1.5-2.5 inches wide. Please measure your straps width and length BEFORE purchasing to make sure they will fit YOUR carseat.\n\nSHIPPING COST\nPlease add items to cart to calculate shipping. \n\nMost items (up to 13 oz) will be shipped via USPS 1st Class Mail for $3 for the first item. Sets (more than 2 items and heavier items) are $4 and up\n\nPlease allow at least a week for delivery.\n\nAll packages are shipped to SHIP TO address specified on your Etsy order. Please make sure it is correct to avoid delays or lost packages. Packages that get lost due to an incorrect SHIP TO address will not be replaced or refunded. If a package returns back because of incorrect address, I will be happy to re-ship the package to a different address, but you will need to pay the shipping charges.\n\nShipping charges are NON-REFUNDABLE.\n\nSHIPPING TIMES\nI usually ship within 1-3 BUSINESS days of receiving your order.\nIf your order requires customization (snaps vs.velcro, different lenght, etc) please allow 2 additional business days.\n\nWhile most packages arrive within 2-5 days please allow at least a week for delivery. Sometimes USPS might take up to 2 weeks to deliver. \nUnfortunately USPS DELAYS, especially during busy holiday season or inclement weather are completely out of our control, so please plan accordingly. Once the package is dropped off at the post office, it is in the control of USPS and it&#39;s their responsibility to deliver the package in the time frame they promised and advertised.\n\nDO YOU LIVE IN NORTH NEW JERSEY OR WESTCHESTER COUNTY OF NY AND WANT TO PICK UP YOUR ORDER?\nPlease contact me so we can discuss the details BEFORE you place the order.\nYou may pick up in person in Parsippany, NJ (any day) or Bronxville, NY (9-3 Mon - Thu)\n\nOTHER FAQS:\nEMBROIDERY: &quot;I&#39;d like to add my child&#39;s name to the product, can you do it?&quot; Unfortunately NO, at this time I do not own an Embroidery Machine, so I cannot do it.\n\n\nCARE:\n- Cotton items can be washed in cool\/warm water with similar colors.\n- Minky with dots should NOT be ironed as the dots will disappear.\n- Faux Fur items should be hand washed and laid flat to dry. DO NOT IRON.\n\nREGARDING STATEMENTS ON SELVAGE HTTP:\/\/WWW.TABBERONE.COM\/TRADEMARKS\/COPYRIGHTLAW\/LICENSEDFABRIC.SHTML\n&quot;A copyright statement as defined in the US Copyright Act is using the symbol \u00a9 along with the word &quot;copyright&quot; (or abbreviated &quot;Copr.&quot;), the first year of publication of the work, and the name of the copyright owner. Nothing else. Any other statement by the copyright owner is irrelevant, extraneous, unenforceable and improper. Many attorneys and company representative will attempt to &quot;claim&quot; that &quot;licensed fabric&quot; is sold for &quot;personal use only&quot; or that the fabric is for &quot;non-commercial home use only&quot;. In some cases they will point to similar wording on the selvage of the fabric. There is absolutely NOTHING in state or federal law that gives a manufacturer, distributor or licensee the authority to impose such restrictions..&quot;\n\nUSE OF LICENSED FABRIC\n&quot;Licensed fabric&quot; means the fabric is licensed by the rights owner to be manufactured and sold. It does not mean the fabric is licensed at the time it is sold by stores to crafters. Crafters & hobbyists can use it to create their own items for sale. Court cases: Precious Moments vs La Infantil, 1997, Scarves By Vera, Inc. v. American Handbags, Inc, 1960.",
