        "announcement":"Hello and Welcome! My items are handmade to order. I do hope you like my items. I use high quality permanent professional inks that are soft and the graphics are sharp. Some of my photos show actual printed shirts.\n\nI now offer gift wrapping service. If you are writing a gift message, please make sure to write it inside the &quot;Message to seller&quot; box when you are checking out so that I can see the message.\n\nPlease note that I can&#39;t do exchanges or returns because my items are only made when you have purchased it. \n\nToddler light blue shirts are a bit darker than Youth light blue shirts because they are made by different brands. \n\nBaby bodysuits fit true to size. \nNewborn (0-3 months) - up to 9 pounds\n6 Months (3-6 months) - 10-16 pounds\n12 Months (6-12 months) 17-20 pounds\n18 Months (12-18 months) 21-24 pounds - my 18 months baby bodysuit is a little bit big.\n\nI ship items in 1-3 days and then there is an additional 3-5 days for delivery. \n\nI love to receive photos of you or your children with shirts or baby bodysuits I send you. If you don&#39;t mind, please do send me photos. It makes me happy to see them. Also, if you don&#39;t mind, I may post them on my etsy shop.\n\nThank you very much for supporting my small shop that is making items in the USA [Made in America] .",
