      "title":"Vintage Scotch Dictionary Print - Cocktail Art - Print on Vintage Dictionary Paper - Scotch Whisky, Whiskey, Mad Men Decor - On The Rocks",
      "description":"A vintage scotch dictionary print of a glass of scotch whisky, printed on vintage dictionary paper.  A perfect gift for him in decorating that man cave, home bar, den, or garage with some classy bar themed wall art.  Inspired by Mad Men, this image of a poured cocktail is sure to help your man take the edge off.\n\nFrame and mat are shown for display purposes only and are not included. Want a frame? Add one to your order here: http:\/\/etsy.me\/1bWBZO4\n\nHOW IT WORKS\n\nVintage dictionary art is a unique process in which we &quot;upcycle&quot; old dictionaries by hand into a beautiful new piece of art. The desirably yellowed pages of our vintage dictionaries present a classy and sophisticated look that works magic for any interior decorating project. It doesn&#39;t matter if your style is modern, vintage, or for the college dorm. Each print comes on a different page of the dictionary, so no two are alike. If you would like to request a page with a certain definition, please send me a message and I will confirm availability.\n\nPAPER SIZE\n\nOur prints do not come framed or matted, however they are printed to perfectly fit them. By default, every print measures approximately 8.5x11 inches. However, each print is sized such that the printed design is fully visible when used with a standard frame matted to 8x10 (i.e. with a viewable window size of 7.5 x 9.5). The margins of the page will fit neatly behind your mat and allow you to easily attach your print to the mat.\n\nPlease let me know if you intend to display your print in an unmatted 8.5x11 document frame, and I will slightly adjust the print scaling to fill out the entire page. If you would like the print to measure an exact 8x10 inches, I am happy to trim the margins of the page for you. This option is available by special request in the notes section at checkout.\n\nSHIPPING\n\nAll of our prints ship in durable cardboard mailers via USPS First Class Mail. Prints will ship within 1-3 business days of your order, but in most cases, I am able to ship the next day. USPS provides delivery confirmation for all domestic shipments. Delivery time is generally 2-3 business days. Shipping upgrades available upon request.\n\nFor international orders, we use USPS First Class International. Please note that due to your country&#39;s postal service or customs inspections, prints can take anywhere from 7 to 30 business days to arrive. Due to the high cost of upgraded international shipping, tracking is not included by default with international orders. International shipping upgrades available upon request. Approximate delivery times to Canada and the UK are 5-10 business days.\n\n\u00a9 2015 DictionArt. All rights reserved.",
