      "description":"\u2605\u2605\u2605\u2605PLEASE NOTE THIS IS A DIGITAL ITEM. I DO NOT SHIP A PHYSICAL LABEL.\u2605\u2605\u2605\u2605 \n\nLooking for a PRINTED label? Check out my shop page to find a wide selection of printed labels. \n\nThis is a listing for a personalized version of a liquor label design of your choosing. This item is a DIGITAL item. Once you purchase this product I will send you a direct message with the information needed. Processing time is 1-2 business days. \n\n**If you love the design but need it for a different occasion or you want it to have a different message, let me know! I&#39;ll be happy to change it.**\n\n*Again, this is a DIGITAL design*\n\nThe listing price is for digital files that I will customize personally for you. Once you have approved the final design, I will email you the final print files to use for at home printing or to take to a local printer. All my files are high quality 300 DPI, CMYK color, JPG, PNG or PDF&#39;s, please let me know which you prefer or if you prefer more than one. Purchasing a digital file, you can print as many as you need saving you money on designs you can not find anywhere else!\n\nWHAT IS INCLUDED IN THE LISTING DESIGN FEE?\n~Edible cake topper design with dimensions of your choosing OR label design\n~Ready to print file\n~2 Design revisions\n~High resolution, 300 DPI print-ready JPEG or PDF\nSimply add (1) to your cart and place your order.\n\nPlease note all items are for PERSONAL USE ONLY. File sharing, distributing, or selling the designs, or ANY elements within them, in any other format including templates, websites, brochures, advertising or on any products is strictly prohibited. When purchasing a product you agree to use the designs for personal use only. Commercial use is not allowed. Designs are intended for ONE TIME use only. Your purchase is for the labor and time involved in creating your customizations.\n\nPlease, if you have any questions, do not hesitate to ask! I&#39;m at your service.\n\n(Disclaimer: Actual color of label may vary slightly from the color on your computer screen due to the printing process)",
