        "sale_message":"Thank you for purchase at Kustom Products! \r\n\r\nMost items are shipped out in 3-5 days, a few of the items take 1-2 weeks from date of purchase.  When the item is shipped you will receive a note with the ship date and tracking number for your convenience.\r\nPlease let me know if you have any questions!\r\n\r\n**WE HAVE PRODUCT GIVEAWAYS EVERY MONTH ON OUR FACEBOOK PAGE!!\r\nhttps:\/\/www.facebook.com\/KustomProductsInc\r\n\r\nHave a wonderful day,\r\nKate\r\n\r\nIf you have any questions please email us directly through Etsy to receive the quickest response.\r\n",
        "digital_sale_message":null,
