        "announcement":"Thanks for stopping by KMSORIGINAL!\nPlease note all of my crafting supplies will now be in my new shop, SuppliesNVintage:\nhttps:\/\/www.etsy.com\/shop\/SuppliesNVintage?ref=hdr_shop_menu\nI hope you will check it out!\nI started sewing in Jr. High and never stopped. I love creating new things. I make all the handmade  items in my store myself . You will see many different products, mainly because new ideas are always popping up in my head and I think, &quot; I want to make that&quot;. I hope you will find something you like for yourself or a gift for someone else. Some items match other items. Such as a purse and shirt. Pet bandanas match some of these items also, they can be found in my DogandCatWorld Shop . If you would like something custom made out of a fabric you see, convo me and I will see if I have that enough of that fabric to make what you want. Or if you would like something in another color let me know and we&#39;ll see if that is possible.\nI hope you enjoy shopping in my store. I will be adding new items in all sections, so check back frequently. And add my shop to your favorites so you can find me again.\nAll handmade items in my shop are made in my smoke free home in \nPort St. Lucie FL.\nItems are returnable at buyers expense for 7 days after receiving order. Unless I state that the item is not returnable. Please make sure you convo me with any questions, especially about those items.\n\n Please check out my other shops: \nSuppliesNVintage  This shop will have all of my crafting supplies and also my vintage finds all in one shop.\nhttps:\/\/www.etsy.com\/shop\/SuppliesNVintage?ref=hdr_shop_menu\nAnd  DogAndCatWorld This shop has my handmade pet items like costumes, bandanas and more:\nhttp:\/\/www.etsy.com\/shop\/DogAndCatWorld?ref=ss_profile\nThanks again for shopping at KMSORIGINAL.\nKathy",
