      "title":"Wine Bottle Vest Pirates and Skulls And Top Hat Whiskey Bottle Vest Pirates and Skulls",
      "description":"Going to a pirate event? Or just into pirates and Skulls? \nCheck out this cool Wine Bottle Vest with Pirates and skulls and crossbones!\nIt will fit any bottle of liquor that is the size of a wine bottle.\nTake to a party as a gift for your host or hostess and everyone will be impressed!\nUnique and fun, this tuxedo wine bottle cover is made of black cotton blend fabric with white skulls some with pirate hats and swords and skulls with bandanas and earrings. \nIt would look great on any color of wine.\n It is fully lined in black fabric.\nThere are brass metal buttons down the front.\nAnd to finish it off, a black satin bow tie. \nThe vest just slips over the bottle. \nElastic on the back holds it in place. \nThis tuxedo wine bottle cover makes a great host or hostess gift!\n\nYour Wine Bottle will come nicely packaged.\n\nMy tuxedo vests are available in:  gold, teal, purple, and mulberry. Also chef aprons and hats, leather vests with cowboy hats, flames and many more!\nThey are nice gifts for:\n\nHost or Hostess gift\nWedding gift \nThanking your wedding attendants \nCongratulating for a promotion\nAnniversary gift\nBirthday gift\nChristmas gift\nWelcome home gift\nHousewarming gift\n\nI take great care in making my WineWear. They are not anything like the cheap ones you find at the party store.\n\n***I will combine shipping on multiple items, please convo me BEFORE you purchase them.\n\nCheck out  all my Wine Wear in my Wine Wear and Wine Bags section of my store:\nhttp:\/\/www.etsy.com\/shop\/KMSORIGINAL?section_id=7131525\n\nThank you shopping in my store!\n\nWould you like to go back to my store?\nhttp:\/\/www.etsy.com\/shop\/KMSORIGINAL\n\nDo you have a dog, cat or maybe a bunny? Check out my other shop DogAndCatWorld where all my Handmade Pet Items are, including pet bandanas, pet costumes and more.\ndogandcatworld.etsy.com\n\nMy new SuppliesNVintage  Shop has craft supplies and unique vintage finds:\nhttps:\/\/www.etsy.com\/shop\/SuppliesNVintage?ref=shop_sugg\n\n My friend Lu&#39;s store, etonstreet has cool handmade, one of a kind sculptures! Check them out!\nhttp:\/\/www.etsy.com\/shop\/etonstreet?ref=ss_profile\n\nFor some beautiful macram\u00e9 plant hangers to hang your plants inside or out, check out my sister&#39;s new shop to see her cool macram\u00e9 hangers:\nhttps:\/\/www.etsy.com\/shop\/MacrameAndCrochet?ref=l2-shopheader-name",
