      "description":"ABOUT THIS LISTING\n\nThe invitation is customizable for any age or phrasing.  This listing is for a PRINT IT YOURSELF invitation \nin a high resolution 300 dpi digital file.\nPlease choose a size in the drop down menu.  It is available in 4x6 or a 5x7.  \nPlease note that no actual product will be shipped. \n\nYou will receive 2 digital files on your email \n- 5x7 or 4x6 inch printable high resolution JPG file\n-  5x7 or 4x6 size printable high resolution PDF file with 2 invitations per 8.5\u201d x 11\u201d page with bleed and crop marks for easy cutting.\n\nHow To Order:\n1)\tAdd the listing to your cart.\n2)\tChoose your size 4x6 or 5x7\n3)\tIn &quot;note to seller&quot; provide the following information:\na.   Guest of Honor\nb.   Age\nc.\tDate of Event\nd.\tTime of Event\ne.\tAddress\nf.\tRSVP Info\ng.\tAdditional Information \u2013The invitation wording is completely customizable.  \n4)\tWithin 24-48 hours, I will send you digital proof of your invitation to the provided email address. Please read and verify your proof carefully for spelling, punctuation and grammar. Reply to me via Etsy messenger with approval or let me know if you need any changes. Once final approval has been established, high-resolution printable files will be sent on your e-mail.\n\nOnce you receive your invitation, you may print at home, photo lab or email.  Please note that colors you see on monitor may vary to what is printed. That depends on monitor and printer settings.\n\nIf you have any questions, please feel free to message me.  \n\n\nBecause this is a personalized item and due to its digital nature, refunds will not be granted once the item, or initial personalized proof of item, has been delivered to your email. You may cancel your order and request a full refund at any time before the proof has been delivered to your email. To request a refund before the file is sent to you please contact me via Etsy.  \n\nThis file is for personal use only. Mass production, file sharing, & commercial\nuse are not permitted. All rights reserved by Dragonfly Papier by Lizet-",
