        "policy_additional":"CARE INSTRUCTIONS\nWashing\/ care instructions vary by item and are listed under each item&#39;s description.  If you have any further questions on the care of your item please feel free to message me!\n\nSHIPPING\nI ship all packages via USPS first class mail unless customer upgrades to priority shipping.  Shipping generally takes 5-7 days once post office receives the package (please note this does not include shop&#39;s processing time).  International customers generally take 2-4 weeks, depending on customs. \n\nPlease ensure shipping address is entered correctly at checkout; the shop will not be liable for packages going to an address that is entered incorrectly. Please make sure to double check shipping address before purchasing.\n\nEXCHANGE POLICY\nI do accept exchanges as long as the item is returned by the customer within 21 days of delivery; buyer is responsible for return shipping.  Please make sure to include which size you are exchanging for.  \n\nI do not accept returns at this time - please contact me if you have any problems with your order!\n\nRETURN POLICY\nI do not accept returns at this time; however, I want you to love your purchase!  I make every attempt to fully and accurately describe all of the items in my shop. If for some reason you&#39;re not happy with your purchase, please contact me as soon as possible.\n\nLOST PACKAGES\nLost packages:\nOnce an item has left the shop, the shop cannot be held responsible for any lost, damaged or delayed packages. If an item is showing delivered but you have not received it, please contact USPS, and check with neighbors. If your tracking information is not updating or you have any other shipping issues, please contact USPS.  USPS does not consider a domestic package to be lost until after 30 days. International orders are not considered lost until after 6 weeks. If your package is considered lost by the post office, please contact me at that time.\n\nSHIPPING TIME ESTIMATES\nYou&#39;re always welcome to contact the shop for questions regarding ship time and I&#39;m happy to provide an estimate but please note I cannot guarantee delivery dates once the order has arrived at the post office and am not responsible for shipping delays.  Actual shipping time will depend on the shipping option you choose at checkout; if you need your order faster than standard First Class shipping I do offer Priority shipping options at check out.\n\nCUSTOM AND PERSONALIZED ORDERS\nWe do offer text customization.  Please contact us BEFORE ordering to make sure we are able to accommodate your request and we will send a custom link to purchase from once the design has been approved.  As always, please contact us with questions!\n\nQUESTIONS ABOUT MY ORDER\nIf you have questions regarding sizing, tank design, or customization, please contact the shop BEFORE placing your order.  Once an order has been placed we can not edit the order and the order can not be cancelled.  As always, feel free to contact us with any questions you may have about the tanks, shipping, or care instructions.",
